svg.script:
var p_sek, p_min, p_stund,p_rund,p_rundh ;
var i;
function $(id) { return document.getElementById(id); }
function inic() {
	p_sek = $("Sekunde");
	p_min = $("Minute");
	p_stund = $("Stunde");
	p_rund = $("ballrot");
	p_rundh = $("Ball2");
	var d = new Date();
	i = d.getSeconds() + d.getMinutes() * 60 + d.getHours() * 3600;
	var intervalo = setInterval(atualizar, 1000);
}
function atualizar() {
	p_stund.setAttribute("transform", "rotate(" + (i * .0083333) + ", 140, 140)");
	p_min.setAttribute("transform", "rotate(" + (i * .1) +", 140, 140)");
	p_sek.setAttribute("transform", "rotate(" + (i * 6) + ", 140, 140)");
	p_rund.setAttribute("transform", "rotate(" + (i *3) + ", 140, 140)");		
	p_rundh.setAttribute("transform", "rotate(" + (i *1.5) + ", 140, 140)");	
	if(i > 86400) i = 0;
	i++;
}
window.onload = inic;
